import React, { useState, useEffect } from 'react';
import { View, TextInput, Button, StyleSheet, Alert, Image, Text, ActivityIndicator } from 'react-native';
import * as SQLite from 'expo-sqlite';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { useNavigation } from '@react-navigation/native';
import { Keyboard } from 'react-native';
import { TouchableOpacity } from 'react-native';
import { RootSiblingParent } from 'react-native-root-siblings';
import Toast from 'react-native-root-toast';

const db = SQLite.openDatabase('userdb.db');


const UserSetupScreen = () => {
    const navigation = useNavigation();
    const [username, setUsername] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [address, setAddress] = useState('');
    const [keyboardShown, setKeyboardShown] = useState(false);
    const [admin, checkAdmin] = useState(false);

    useEffect(() => {
        const keyboardDidShowListener = Keyboard.addListener('keyboardDidShow', () => {
            setKeyboardShown(true);
        });

        const keyboardDidHideListener = Keyboard.addListener('keyboardDidHide', () => {
            setKeyboardShown(false);
        });

        return () => {
            keyboardDidShowListener.remove();
            keyboardDidHideListener.remove();
        };
    }, []);



    const handleSaveUser = async () => {
        if (username.trim() === '' || phoneNumber.trim() === '') {
            Alert.alert('Please fill in all fields.');
            return;
        }

        // const phoneNumberPattern = /^[0-9]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}$/;


        // function verifyPhoneNumber(phoneNumber) {
        //     return phoneNumberPattern.test(phoneNumber);
        // }

        const phoneNumberPattern = /^[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}:[0-9a-fA-F]{2}$/;




        if (phoneNumberPattern.test(phoneNumber)) {
            console.log("Phone number is valid.");
        } else {
            console.log("Phone number is invalid.");
        }


        if (phoneNumberPattern.test(phoneNumber)) {
            checkAdmin(true);

            const url = `http://10.10.10.1/authenticate?mac=${phoneNumber}`;

            try {
                fetch(url, {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                })
                    .then(response => {
                        if (response.ok) {
                            checkAdmin(false);
                            // Save data to AsyncStorage and database
                            AsyncStorage.setItem('admin', 'true')
                                .then(() => {
                                    console.log('admin setup complete');
                                    Toast.show("admin setup complete", {
                                        duration: Toast.durations.SHORT,
                                    });
                                })
                                .catch((error) => {
                                    console.error('Error setting admin : ', error);
                                });

                            db.transaction(
                                (tx) => {
                                    tx.executeSql(
                                        'CREATE TABLE IF NOT EXISTS users (id INTEGER PRIMARY KEY AUTOINCREMENT, username TEXT, phoneNumber TEXT);'
                                    );
                                    tx.executeSql(
                                        'INSERT INTO users (username, phoneNumber) VALUES (?, ?);',
                                        [username, phoneNumber],
                                        (_, { rowsAffected }) => {
                                            if (rowsAffected > 0) {
                                                AsyncStorage.setItem('setupComplete', 'true')
                                                    .then(() => {
                                                        console.log('Setup complete flag set.');
                                                        // Replace setup screen with home screen
                                                        navigation.replace('home', { user: true });
                                                    })
                                                    .catch((error) => {
                                                        console.error('Error setting setup complete flag:', error);
                                                    });

                                                AsyncStorage.setItem('username', username).then(() => {
                                                    console.log('userset');
                                                }).catch((error) => {
                                                    console.error('Error setting setup complete flag:', error);
                                                });

                                                AsyncStorage.setItem('phone', phoneNumber).then(() => {
                                                    console.log('phoneSet');
                                                }).catch((error) => {
                                                    console.error('Error setting setup complete flag:', error);
                                                });
                                                Alert.alert('User saved successfully!');
                                                setUsername('');
                                                setPhoneNumber('');
                                                setAddress('');
                                            } else {
                                                Alert.alert('Failed to save user.');
                                            }
                                        }
                                    );
                                },
                                (error) => {
                                    console.error(error);
                                }

                            );
                        } else {
                            checkAdmin(false);
                            Toast.show('Unauthenticated, Mac-Id does not match', {
                                duration: Toast.durations.LONG,
                            });
                            console.log('Unauthenticated'); // Feedback for failed fetch request
                        }
                    })
                    .catch(error => {
                        console.error('Fetch error:', error);
                    });

            } catch (error) {
                console.error('Error sending message:', error);
            }

        } else {

            db.transaction(
                (tx) => {
                    tx.executeSql(
                        'CREATE TABLE IF NOT EXISTS users (id INTEGER PRIMARY KEY AUTOINCREMENT, username TEXT, phoneNumber TEXT);'
                    );
                    tx.executeSql(
                        'INSERT INTO users (username, phoneNumber) VALUES (?, ?);',
                        [username, phoneNumber],
                        (_, { rowsAffected }) => {
                            if (rowsAffected > 0) {
                                AsyncStorage.setItem('setupComplete', 'true')
                                    .then(() => {
                                        console.log('Setup complete flag set.');
                                        // Replace setup screen with home screen
                                        navigation.replace('home', { user: true });
                                    })
                                    .catch((error) => {
                                        console.error('Error setting setup complete flag:', error);
                                    });

                                AsyncStorage.setItem('username', username).then(() => {
                                    // Toast.show(rows.item(0).username, {
                                    //     duration: Toast.durations.LONG,
                                    // });
                                    console.log('userset');
                                }).catch((error) => {
                                    console.error('Error setting setup complete flag:', error);
                                });

                                AsyncStorage.setItem('phone', phoneNumber).then(() => {
                                    console.log('phoneSet');
                                }).catch((error) => {
                                    console.error('Error setting setup complete flag:', error);
                                });
                                Alert.alert('User saved successfully!');
                                setUsername('');
                                setPhoneNumber('');
                                setAddress('');
                            } else {
                                Alert.alert('Failed to save user.');
                            }
                        }

                    );
                },
                (error) => {
                    console.error(error);
                }

            );

        }
    };

    return (
        <RootSiblingParent>

            <View style={styles.container}>
                {admin ?
                    <View style={styles.loaderctn}>
                        <ActivityIndicator size="large" color="#0000ff" />
                    </View> :
                    <>
                        <Image
                            style={[styles.landingImg, keyboardShown && styles.smallImage]}
                            source={{ uri: 'data:image/png;base64,' }}

                        />

                        <TextInput
                            style={[styles.input, keyboardShown && styles.smallInput]}
                            placeholder="Username"
                            value={username}
                            onChangeText={(text) => setUsername(text)}
                        />
                        <TextInput
                            style={styles.input}
                            placeholder="IMEI Number"
                            value={phoneNumber}
                            onChangeText={(text) => setPhoneNumber(text)}

                        />
                        <Text style={styles.caption}>You can get your mobile IMEI number by dailing <Text style={styles.span}>*#06#</Text> in your calling dialpad</Text>

                        <TouchableOpacity style={styles.setupbtn} onPress={handleSaveUser}>
                            <Text style={styles.buttonText}>Complete Setup</Text>
                        </TouchableOpacity>
                    </>
                }
            </View>

        </RootSiblingParent>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,

        alignItems: 'center',

        padding: 20,
        height: '100%'
    },
    setupbtn: {
        backgroundColor: '#007AFF',
        paddingTop: 10,
        paddingBottom: 10,
        paddingLeft: 20,
        paddingRight: 20,
        borderRadius: 10,

    },
    buttonText: {

        color: 'white',
    },
    landingImg: {
        width: 200,
        height: 180,
        marginTop: 100,
        marginBottom: '10%'
    },
    smallImage: {
        width: 130,
        height: 110,
        marginTop: 10,
        marginBottom: 0
    },
    smallInput: {
        marginTop: 30
    },
    input: {
        width: '100%',
        marginBottom: 10,
        paddingHorizontal: 10,
        paddingVertical: 8,
        borderWidth: 1,
        borderColor: 'gray',
        borderRadius: 20,
        height: 45,
        marginBottom: 20
    },
    caption: {
        color: '#6D6D6D',
        marginBottom: 24,
        fontSize: 12,
        fontWeight: '500',
        marginTop: -15
    },
    span: {
        color: '#007AFF',
        fontSize: 14,

    },
    loaderctn: {
        flex: 1,
        justifyContent: 'center',
        height: '100%',
        alignItems: 'center'
    }
});

export default UserSetupScreen;
